import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './Header';
import NavBar from './NavBar';
import Home from './Home';
import About from './About';
import Unit from './Unit';
import './App.css';

function App() {
  const topics = [
    ['Types of Variables', 'Converting Categorical Data into Numeric Data'],
    ['K-Means', 'Principal Component Analysis (PCA)']
  ];
  let subUnitList = topics.map((list, unitIndex) => list.map((title, subUnitIndex) => <li><Link to={`/unit${unitIndex}_${subUnitIndex}`} className='subunit'>{title}</Link></li>));
  let subUnitRoutes;
  if (unit - 1 < topics.length) {
    subUnitRoutes = topics[unit - 1].map((title, index) => <Route path={`/unit${unit}_${index}`} element={<Page unit={unit} index={index} />}></Route>);
  }
  return (
    <div>
      <BrowserRouter>
        <Header />
        <NavBar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          {topics.map((list, index) => <Route path={`/unit${index}`} element={<Unit unit={index+1} subUnitList={subUnitList}/>}></Route>)}
